import React, { Component } from 'react'

class CreateWO extends Component{
    constructor(props){
        super(props);
        this.state = {
            w_projectid: '',
            w_WOnum: 0,
            w_desc: '',
            w_status: '',
            w_reporteddate: '',
            w_location: '',
            w_type: '',
            w_TPID: '',
            w_PSProject: '',
            w_PSProjDesc: '',
            w_PSActivity: '',
            w_PSActDesc: '',
        }

        this.onChange = this.onChange.bind(this);
    }

    onChange(event){
        this.setState({
            [this.state.event.name] : [this.state.event.target]
        })
    }

    onSubmit(){
        console.log("SUCCESSFULLY SUBMITTED FORM")

        this.setState({
            w_projectid : '',
            w_WOnum: 0,
            w_desc: '',
            w_status: '',
            w_reporteddate: '',
            w_location: '',
            w_type: '',
            w_TPID: '',
            w_PSProject: '',
            w_PSProjDesc: '',
            w_PSActivity: '',
            w_PSActDesc: '',
        })
    }

    render(){
        return(
            <div>
                <h1>HELLO WORLD FROM THE CREATE WORKORDER PAGE</h1>
            </div>
        )
    }
}

export default CreateWO;
